  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Rice Lake
  NWR and Mille Lacs NWR outlines Refuge accomplishments during the 1982 calendar
  year. The report begins with an introduction to the Refuge and information about
  climatic and habitat conditions, and the system status. Construction and maintenance
  are also described. Habitat management is covered; croplands, grasslands, wetlands,
  forestlands, and wilderness and special areas are discussed. The wildlife section
  of the report discusses endangered species, migratory birds, mammals, and non-migratory
  birds. Interpretation and recreation activities are outlined; topics include information
  and interpretation, recreation, and law enforcement. Field investigations, cooperative
  programs, items of interest, and safety information are discussed. Photographs are
  attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
